import { Task } from "../pages/Tasks";
import { Layout } from "../pages/Layout";
import { AddTask } from "../pages/AddTask";

export const router = createBrowserRouter([
    {
        path: "/",
        element: <Layout />,
        children: [
            {
                path: "",
                element: <Task />,
            },
            {
                path: "add-task",
                element: <AddTask />,
            },
        ]
    }
]);
